// headder designe 
import classes from './Headder.module.css';
function Headder(){
    return (
        <header>
            <div className={classes.logo}>
                <img src='../rec/logoround.jpg' alt='gec round logo'/>
            </div>
            <div className={classes.gecLogo}>
                <img src='../rec/logonew.jpg' alt = 'kits logo'/>
            </div>
            <div className={classes.kitsLogo}>

            </div>
            {/* <nav>
            </nav> */}
            
        </header>
    );
}
export default Headder;
